import React, { useState } from "react"
import Card from "react-bootstrap/Card"
import API from "../../utils/API";


function NewPatient(props) {
    const [currentPt, setCurrentPt] = useState({})
    let patient

    // function renderSwitch(currentPt) {
    switch (currentPt) {
        case {}:
            patient = (<button
                className="btn btn-success"
                onClick={setCurrentPt({ status: "pending" })}
            >
                <h4>Start New Patient Report</h4>
            </button>)
            break
        case "{status:pending}":
            patient = <p>There is a pending patient</p>
            break
        default:
            // patient = (<button
            //     className="btn btn-success"
            //     onClick={setCurrentPt({ status: "pending" })}
            // >
            //     <h4>Start New Patient Report</h4>
            // </button>)
    }
    // }

    function goToEmsDash() {
        props.onClick("")
    }

    return (
        <Card>
            <Card.Header>
                <h1>New patient</h1>
            </Card.Header>
            <Card.Body>
                <div>
                {patient}
                </div>
                {/* <button className="btn btn-dark"><h4>Previous Patient</h4></button> */}
            </Card.Body>
            <button
                className="btn btn-dark"
                onClick={goToEmsDash}
            ><h4>Back</h4></button>
        </Card>
    )
}

export default NewPatient
